import React from 'react'
import { createBrowserRouter } from "react-router-dom";
import App from './components/App';
import Front from './components/Front';

const Routing = createBrowserRouter([
    {
        path:"",
        element:<App/>,
        children:[
            {
                path:"",
                element:<Front/>
            },
            {
                path:"/Html_Css",
                element:<H/>
            }
        ]

        

    }
]
    
)

export default Routing
